import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';

function Navbar() {
  let [isClicked, setIsClicked] = useState(false);

  let handleClick = () => {
    setIsClicked(true);
  };

  return (
    <div className='nav-comp'>
      <NavLink to='/' className={isClicked ? 'clicked' : 'not-clicked'} onClick={handleClick}>
        Home
      </NavLink>
      <NavLink to='/About' className={isClicked ? 'clicked' : 'not-clicked'} onClick={handleClick}>
        About Us
      </NavLink>
      <NavLink to='/SignIn' className={isClicked ? 'clicked' : 'not-clicked'} onClick={handleClick}>
        Sign In
      </NavLink>
      <NavLink to='/SignUp' className={isClicked ? 'clicked' : 'not-clicked'} onClick={handleClick}>
        Sign Up
      </NavLink>
    </div>
  );
}

export default Navbar;
